import React from 'react';

import './style.css';

export default function ModalCar(){
    return (
        <div style={style.parentDiv}></div>
    )
};

const style={
    parentDiv:{
        backgroundColor: "#a8a8a8",
        position: "absolute",
        zIndex:"9999",
        width: "100%",
        height: "100%"
    }
};
